import React from 'react';
import 'rsuite/dist/styles/rsuite-default.css';

const ContactInfo=():JSX.Element=>{
    const output:any=[];

     const contactinfo:any=[{
       email:"facebooksquare.com",
       contactNumber:"9371084258",

    },
    {
       email:"linkedinsquare.com",
       contactNumber:"9371084258",
    },

]


    const getContactInfo=()=>{
      Array.isArray(contactinfo) && contactinfo.forEach((items)=>{
        output.push(
          <div>
           <p>{items.email}</p>
            <br/>
            <p>{items.contactNumber}</p>
            </div>
        );
      })
      return output;
    }

    return(
        <div>
   {getContactInfo()}
        </div>
    )
}

export default ContactInfo;
